import { ICharacter } from "../../interfaces/ICharacter";

const SearchResults = ({
  characters,
  status,
  queryError,
  onDelete,
  onSelect,
}: any) => {
  <div>
    {status !== "ERROR"
      ? characters.map((c: ICharacter) => (
          <div onClick={onSelect}>
            <button onClick={onDelete}>X</button>
            <img key={parseInt(c.id, 10)} src={c.image} alt={c.name} />
          </div>
        ))
      : queryError}
  </div>;
};

export default SearchResults;
